import React, { Fragment } from 'react';
const Faq = ({id, title, desc}) => {
  return (
    <Fragment>
<article>
    <div>
        <h4>{title}</h4>
        <button>+</button>
    </div>
        <p>{desc}</p>
</article>
    </Fragment> 
  )
}
export default Faq;

const faq = {
  margin: '1rem',
  backgroundColor: 'red',
  padding: '1rem',
  borderRadius: '0.6rem',
  boxShadow: '0.1rem 0.1rem'
}
const faqDiv = {
  display: 'flex',
  justifyContent: 'space-between'
}
